@OptIn(ExperimentalMaterial3Api::class)
@Composable
fun TooltipHelp(
    title: String,
    text: String
) {
    var tooltipState: TooltipState = rememberTooltipState(isPersistent = true)
    val coroutineScope: CoroutineScope = rememberCoroutineScope()

    TooltipBox(
        tooltip = {
            RichTooltipWithoutAction(
                text = text,
                title = title,
            )
        },
        positionProvider = TooltipDefaults.rememberPlainTooltipPositionProvider(),
        state = tooltipState
    ) {
        IconButton(
            colors = IconButtonDefaults.iconButtonColors(
                contentColor = MaterialTheme.colorScheme.primary
            ),
            onClick = { coroutineScope.launch { tooltipState.show() } }
        ) {
            Icon(
                imageVector = Icons.Filled.Info,
                contentDescription = "information"
            )
        }
    }
}

@OptIn(ExperimentalComposeUiApi::class, ExperimentalComposeApi::class)
@Composable
fun LineChartWidgetResult(
    modifier: Modifier = Modifier,
    onClickDownloadPDF: (CaptureController) -> Unit,
    category: CategoryUiState,
    answers: List<AnswerUiState>
) {
    val captureController: CaptureController = rememberCaptureController()
    val title: String = category.name.lowercase().replaceFirstChar { it.uppercase() }

    Column(
        modifier = modifier.fillMaxWidth(),
        horizontalAlignment = Alignment.CenterHorizontally,
        verticalArrangement = Arrangement.spacedBy(8.dp)
    ) {
        Row(
            modifier = Modifier.fillMaxWidth(),
            horizontalArrangement = Arrangement.Center,
            verticalAlignment = Alignment.CenterVertically
        ) {
            TextTile(title = "Escala de $title")
            TooltipHelp(
                title = "Escala de $title",
                text = category.description
            )
        }
        LineChartWidget(
            modifier = Modifier.capturable(captureController),
            data = answers,
            range = category.range
        )
        ButtonDownloadPDF(
            onClick = {
                onClickDownloadPDF(captureController)
            }
        )
    }
}

@Composable
fun ResultsByCategory(
    modifier: Modifier = Modifier,
    answersByCategory: Map<CategoryUiState, List<AnswerUiState>>,
    onClickDownloadPDF: (CaptureController) -> Unit
) {
    Column(
        modifier = modifier,
        horizontalAlignment = Alignment.CenterHorizontally,
        verticalArrangement = Arrangement.spacedBy(64.dp)
    ) {
        answersByCategory.forEach { (category, answers) ->
            answers.groupBy { it.type }.forEach { (type, answers) ->
                when (type) {
                    Type.RANGO -> {
                        LineChartWidgetResult(
                            category = category,
                            answers = answers,
                            onClickDownloadPDF = onClickDownloadPDF
                        )
                    }
                    Type.EMOCION -> {
                        answers.forEach { answer ->
                            SelectedEmotionResult(
                                image = answer.image!!,
                                state = answer.answer
                            )
                        }
                    }
                }
            }
        }
    }
}

@Composable
fun Content(
    modifier: Modifier = Modifier,
    answersByCategory: Map<CategoryUiState, List<AnswerUiState>>,
    onClickStart: () -> Unit,
    onResultsEvent: (ResultsEvent) -> Unit,
) {
    Column(
        modifier = modifier
            .fillMaxSize()
            .verticalScroll(rememberScrollState()),
        horizontalAlignment = Alignment.CenterHorizontally,
        verticalArrangement = Arrangement.Center
    ) {
        if (answersByCategory.isEmpty()) {
            WithoutResults(
                modifier = Modifier.padding(16.dp),
                onClickStart = onClickStart
            )
        } else {
            ResultsByCategory(
                modifier = Modifier.padding(16.dp),
                answersByCategory = answersByCategory,
                onClickDownloadPDF = { captureController ->
                    onResultsEvent(ResultsEvent.OnClickDownloadPDF(captureController))
                }
            )
        }
    }
}

@Composable
fun ResultsScreen(
    modifier: Modifier = Modifier,
    answersByCategory: Map<CategoryUiState, List<AnswerUiState>>,
    onClickStart: () -> Unit,
    informationState: InformationStateUiState,
    onResultsEvent: (ResultsEvent) -> Unit,
    onNavigateToResults: () -> Unit,
    onNavigateToActivities: () -> Unit,
    onNavigateToSettings: () -> Unit,
    onNavigateToTips: () -> Unit
) {
    val snackbarHostState: SnackbarHostState = remember { SnackbarHostState() }

    CoroutineManagementSnackBar(
        snackbarHostState = snackbarHostState,
        informationState = informationState
    )

    Scaffold(
        modifier = modifier,
        content = { paddingValues ->
            Content(
                modifier = Modifier.padding(paddingValues = paddingValues),
                answersByCategory = answersByCategory,
                onClickStart = onClickStart,
                onResultsEvent = onResultsEvent
            )
        },
        bottomBar = {
            ZaritcareNavBar(
                onNavigateToForms = onNavigateToResults,
                onNavigateToActivities = onNavigateToActivities,
                onNavigateToTips = onNavigateToTips,
                onNavigateToSettings = onNavigateToSettings,
                selectedPage = 0
            )
        },
        snackbarHost = {
            SnackbarHost(hostState = snackbarHostState) {
                SnackbarCommon(informationState = informationState)
            }
        }
    )
}

